import React from 'react';
import Hero from './Hero';
import Navbar from '../Navbar';
import CreateTicket from './CreateTicket';
import Footer from '../Footer';
function SupportPage() {
    return ( 
        <>
            <Navbar/>
            <Hero/>
            <CreateTicket/>
            <Footer/>
        </>
    );
}

export default SupportPage;
